    function startDQTimer(secs) {
//clearInterval(dqtimeleft);
    // Find the distance between now and the count down date
    var distance = secs-1;

    dqtimeleft = setInterval(function() {
    distance--;
//	console.log(distance);
    // Time calculations for days, hours, minutes and seconds
    var hours = Math.floor((distance % (1 * 60 * 60 * 24)) / (1 * 60 * 60));
    var minutes = Math.floor((distance % (1 * 60 * 60)) / (1 * 60));
    var seconds = Math.floor((distance % (1 * 60)) / 1);
    hours = hours < 10 ? "0" + hours : hours;
    minutes = minutes < 10 ? "0" + minutes : minutes;
    seconds = seconds < 10 ? "0" + seconds : seconds;

    var shorthours = Math.floor((distance % (1 * 60 * 60 * 24)) / (1 * 60 * 60));
    var shortminutes = Math.floor((distance % (1 * 60 * 60)) / (1 * 60));
    var shortseconds = Math.floor((distance % (1 * 60)) / 1);

    // Display the result in the element with id="demo"
    document.getElementById("dqtimer").innerHTML = hours + ":"  + minutes + ":" + seconds;

    var deli = ":";

    if ((distance % 2) == 1) { deli = "<span style='color:black;'>:</span>"; }
    if ((distance % 2) == 0) { deli = "<span style='color:gold;'>:</span>"; }

    if (distance >= 3600) {
    document.getElementById("shortsqtimer").innerHTML = "(" + hours + deli  + minutes + ")";
}
    if (distance < 3600) {
    deli = "<span style='color:black;'>:</span>";
    document.getElementById("shortsqtimer").innerHTML = "(" + minutes + deli + seconds + ")";
}


    // If the count down is finished, write some text
    if (distance < 0) {
    clearInterval(dqtimeleft);
    document.getElementById("dqtimer").innerHTML = "Время истекло";
    document.getElementById("shortsqtimer").innerHTML = "";
}
}, 1000);


}

