    function drawStar(dctx, cx,cy,spikes,outerRadius,innerRadius,color) {
    var rot=Math.random()*Math.PI;
    var x=cx;
    var y=cy;
    var step=Math.PI/spikes;
    dctx.beginPath();
    dctx.moveTo(cx+Math.cos(rot)*outerRadius,cy+Math.sin(rot)*outerRadius);
    for(var i=0;i<spikes;i++) {
    x=cx+Math.cos(rot)*outerRadius;
    y=cy+Math.sin(rot)*outerRadius;
    dctx.lineTo(x,y);
    rot+=step;
    x=cx+Math.cos(rot)*innerRadius;
    y=cy+Math.sin(rot)*innerRadius;
    dctx.lineTo(x,y);
    rot+=step;
}
    dctx.lineTo(cx+Math.cos(rot)*outerRadius,cy+Math.sin(rot)*outerRadius);
    dctx.closePath();
    dctx.lineWidth=5;
    dctx.strokeStyle=color;
    dctx.stroke();
    dctx.fillStyle=color;
    dctx.fill();
};



