    recievedgamemodeParams.roundMap = reader.getUint8(offset, true);
    offset += 1;
    if (reader.byteLength > 12) {
    recievedgamemodeParams.battleRoyale = reader.getUint8(offset, true);
    offset += 1;
}

    console.log('Server protocol version: ' + serverProtocol);
    console.log('Server gamemode: ' + recievedgamemode);
    console.log('Server gamemode Extended: ' + recievedgamemodeExtended);
