    function syncViruses(reader, offset) {
    virusSync = [];
    var numberOfViruses = reader.getUint16(offset, true);
    offset += 2;
    var i = 0;
    for (; i < numberOfViruses; ++i) {
    var virusId = reader.getUint32(offset, true);
    offset += 4;
    virusSync.push(virusId);
}
    setTimeout(killDeadViruses, 0);
}

    function killDeadViruses() {
    var i = 0;
    for (; i < list.length; ++i) {
    if (list[i].cellType == 2) {
    var index = virusSync.indexOf(list[i].id);
    if (index == -1) {
    if (blobs[list[i].id]) {
    //console.log(list[i].id + " not visible");
    blobs[list[i].id].destroy();
}
}
}
}
}













    // packet 6 for updating of the player colors
    function updateColorsViaPid(reader, offset) {
    //console.log('total size 6: ' + reader.byteLength);
    for (;;) {
    //console.log('offset 1: ' + offset);
    // overflow check
    if (offset >= reader.byteLength) { break; }
    var id = reader.getUint16(offset, true);
    offset += 2;
    var color = reader.getUint8(offset, true);
    offset += 1;
    //	console.log('offset 2: ' + offset);
    //	console.log('name',id,name);
    if (id > 0) {
    playerColorIndexes[id] = color;
}
//		console.log('2222',playerNames);
}
}



    // packet 7 for updating of the player colors
    function updateSkinsViaPid(reader, offset) {
    //console.log('total size 7: ' + reader.byteLength);
    for (;;) {
    //console.log('offset 1: ' + offset);
    // overflow check
    if (offset >= reader.byteLength) { break; }
    var id = reader.getUint16(offset, true);
    offset += 2;
    var skin = reader.getUint32(offset, true);
    offset += 4;
    //	console.log('offset 2: ' + offset);
    //	console.log('name',id,name);
    if (id > 0) {
    playerSkins[id] = skin;
}
//		console.log('2222',playerNames);
}
}





    // packet 9 remove pidnames from the array
    function removePidName(reader, offset) {
    if (offset >= reader.byteLength) { return; }
    var id = reader.getUint16(offset, true);
    offset += 2;
    if (id > 0) {
    delete playerNames[id];
    delete playerSkins[id];
    delete playerColorIndexes[id];
}
    //console.log(playerNames);
}














    // packet 10 for updating of the player names



    function updateNamesViaPid(reader, offset) {
//	console.log('total size ' + reader.byteLength);
    for (;;) {
    //console.log('offset 1: ' + offset);
    // overflow check
    if (offset >= reader.byteLength) { break; }
    var id = reader.getUint16(offset, true);
    offset += 2;

    var readChar;
    var name = "";
    for (;;) {
    readChar = reader.getUint16(offset, true);
    offset += 2;
    if (0 == readChar) {
    break;
}
    name += String.fromCharCode(readChar);
}
    //	console.log('offset 2: ' + offset);
    //	console.log('name',id,name);
    if (id > 0) {
    playerNames[id] = name;
}
//		console.log('2222',playerNames);
}
}


