    function drawpvpchat(name,msg,status) {

    if (status == 0) { msg = msg.substr(0,msg.length-4); }
    var lt = new Date();
    var dtaa = lt.toLocaleTimeString();

    var msgstatus = 'user';
    var msgname = htmlspecialchars(name);
    if (status == 1) { msgstatus = 'system'; }
    if (status == 2) { msgstatus = 'system rating'; }
    if (status == 3) { msgstatus = 'pvpcall'; }
    if (status == 4) { msgstatus = 'pvpcall incoming'; }
    if (status == 5) { msgstatus = 'pvpcall incoming reject'; }
    if (status == 6) { msgstatus = 'pvpcall incoming success'; }
    if (status == 7) { msgstatus = 'pvpcall looking'; }
    if (status == 8) { msgstatus = 'pvpcall chatstake public'; }
    var pvpmsg = htmlspecialchars(msg);
    if (status == 3) { pvpmsg = msg; }
    if (status == 4) { pvpmsg = msg; }
    if (status == 5) { pvpmsg = msg; }
    if (status == 6) { pvpmsg = msg; }
    if (status == 7) { pvpmsg = msg; }
    pvpmsg = '<div class="pvp ' + msgstatus + '">' + dtaa + ': <strong>' + msgname + ':</strong> ' + pvpmsg + '</div>';
    $("#pvpchatarea").append(pvpmsg);
    $("#pvpchatarea").scrollTop(500000);


}

