    $("#winnervotewindow").css("margin-left",cca + 'px');


    $("#map1").click(function(){ mapByte = '1'; $("#map1").addClass('green').removeClass('blue');$("#map2,#map3").addClass('blue').removeClass('green'); });
    $("#map2").click(function(){ mapByte = '2'; $("#map2").addClass('green').removeClass('blue');$("#map1,#map3").addClass('blue').removeClass('green'); });
    $("#map3").click(function(){ mapByte = '3'; $("#map3").addClass('green').removeClass('blue');$("#map2,#map1").addClass('blue').removeClass('green'); });

    $("#duration1").click(function(){ durationByte = '1'; $("#duration1").addClass('green').removeClass('blue');$("#duration2,#duration3").addClass('blue').removeClass('green'); });
    $("#duration2").click(function(){ durationByte = '2'; $("#duration2").addClass('green').removeClass('blue');$("#duration1,#duration3").addClass('blue').removeClass('green'); });
    $("#duration3").click(function(){ durationByte = '3'; $("#duration3").addClass('green').removeClass('blue');$("#duration2,#duration1").addClass('blue').removeClass('green'); });

    $("#fulka1").click(function(){ fulkaByte = '1'; $("#fulka1").addClass('green').removeClass('blue');$("#fulka2,#fulka3").addClass('blue').removeClass('green'); });
    $("#fulka2").click(function(){ fulkaByte = '2'; $("#fulka2").addClass('green').removeClass('blue');$("#fulka1,#fulka3").addClass('blue').removeClass('green'); });
    $("#fulka3").click(function(){ fulkaByte = '3'; $("#fulka3").addClass('green').removeClass('blue');$("#fulka2,#fulka1").addClass('blue').removeClass('green'); });


    $("#virus1").click(function(){ virusByte = '1'; $("#virus1").addClass('green').removeClass('blue');$("#virus2").addClass('blue').removeClass('green'); });
    $("#virus2").click(function(){ virusByte = '2'; $("#virus2").addClass('green').removeClass('blue');$("#virus1").addClass('blue').removeClass('green'); });

    $("#mode1").click(function(){ modeByte = '1'; $("#mode1").addClass('green').removeClass('blue');$("#mode2").addClass('blue').removeClass('green'); });
